import React, { useState } from 'react';
import { FolderIcon, DocumentTextIcon, PlusIcon, MagnifyingGlassIcon } from '@heroicons/react/24/outline';

const folders = [
  { name: 'Client Agreements' },
  { name: 'Vendor Contracts' },
  { name: 'Employee Contracts' },
  { name: 'Legal & Compliance' },
];

const contracts = [
  { name: 'Client Master Services Agreement', folder: 'Client Agreements', status: 'Active', expiry: '2025-12-31' },
  { name: 'Statement of Work - Project X', folder: 'Client Agreements', status: 'Active', expiry: '2024-08-15' },
  { name: 'Office Lease Agreement', folder: 'Vendor Contracts', status: 'Active', expiry: '2026-05-31' },
  { name: 'SaaS Subscription - CRM', folder: 'Vendor Contracts', status: 'Active', expiry: '2025-01-20' },
  { name: 'John Doe Employment Contract', folder: 'Employee Contracts', status: 'Active', expiry: 'N/A' },
  { name: 'Jane Smith NDA', folder: 'Employee Contracts', status: 'Active', expiry: 'N/A' },
  { name: 'Terms of Service', folder: 'Legal & Compliance', status: 'Active', expiry: 'N/A' },
  { name: 'Privacy Policy', folder: 'Legal & Compliance', status: 'Active', expiry: 'N/A' },
];

const MyContracts = () => {
  const [activeFolder, setActiveFolder] = useState(folders[0].name);
  const [searchTerm, setSearchTerm] = useState('');

  const filteredContracts = contracts
    .filter(c => c.folder === activeFolder)
    .filter(c => c.name.toLowerCase().includes(searchTerm.toLowerCase()));

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center space-x-4">
        <div className="flex-1 relative">
          <MagnifyingGlassIcon className="pointer-events-none absolute top-3.5 left-4 h-5 w-5 text-gray-400" />
          <input
            type="text"
            placeholder="Search contracts..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full pl-11 pr-4 py-2 border border-gray-300 rounded-md"
          />
        </div>
        <button className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-blue-600 hover:bg-blue-700">
          <PlusIcon className="h-5 w-5 mr-2" />
          Upload Contract
        </button>
      </div>

      {/* Folders */}
      <div className="flex space-x-2 border-b border-gray-200 pb-2">
        {folders.map(folder => (
          <button
            key={folder.name}
            onClick={() => setActiveFolder(folder.name)}
            className={`flex items-center px-4 py-2 text-sm font-medium rounded-md ${
              activeFolder === folder.name
                ? 'bg-blue-100 text-blue-700'
                : 'text-gray-600 hover:bg-gray-100'
            }`}
          >
            <FolderIcon className="h-5 w-5 mr-2" />
            {folder.name}
          </button>
        ))}
      </div>

      {/* Contracts Table */}
      <div className="bg-white shadow overflow-hidden sm:rounded-md">
        <ul className="divide-y divide-gray-200">
          {filteredContracts.map(contract => (
            <li key={contract.name}>
              <button className="block w-full text-left hover:bg-gray-50">
                <div className="px-4 py-4 sm:px-6">
                  <div className="flex items-center justify-between">
                    <p className="text-sm font-medium text-blue-600 truncate">{contract.name}</p>
                    <div className="ml-2 flex-shrink-0 flex">
                      <p className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${
                        contract.status === 'Active' ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'
                      }`}>
                        {contract.status}
                      </p>
                    </div>
                  </div>
                  <div className="mt-2 sm:flex sm:justify-between">
                    <div className="sm:flex">
                      <p className="flex items-center text-sm text-gray-500">
                        <DocumentTextIcon className="flex-shrink-0 mr-1.5 h-5 w-5 text-gray-400" />
                        {contract.folder}
                      </p>
                    </div>
                    <div className="mt-2 flex items-center text-sm text-gray-500 sm:mt-0">
                      <p>Expires: {contract.expiry}</p>
                    </div>
                  </div>
                </div>
              </button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

const Contracts = () => {
  return (
    <div className="space-y-8">
      <div>
        <h3 className="text-xl font-bold text-gray-900">Contracts</h3>
        <p className="text-sm text-gray-500 mt-1">Manage, store, and access all your legal agreements and templates.</p>
      </div>

      <MyContracts />
    </div>
  );
};

export default Contracts;
